	public static void printJson(LayoutInfo info) {
		boolean b=false;
		System.out.print("{\"boxes\":{");
		for (Long box : info.boxes.keySet()) {
			if (b)
				System.out.print(",");
			b = true;
			System.out.print("\""+box+"\": {\"x\":"+info.boxes.get(box).x+", \"y\":"+info.boxes.get(box).y+", \"width\":"+info.boxes.get(box).width+", \"height\":"+info.boxes.get(box).height+"}");
		}
		b=false;
		System.out.print("},\"lines\":{");
		for (Long line : info.lines.keySet()) {
			if (b)
				System.out.print(",");
			b = true;
			ArrayList<java.awt.geom.Point2D.Double> arr = info.lines.get(line);
			System.out.print("\""+line+"\":[");
			for (int i=0;i<arr.size(); i++) {
				if (i>0)
					System.out.print(",");
				System.out.print("{\"x\":"+arr.get(i).x+",\"y\":"+arr.get(i).y+"}");
			}
			System.out.print("]");
			
		}
		b=false;
		System.out.print("},\"labels\":{");
		for (Long label : info.labels.keySet()) {
			if (b)
				System.out.print(",");
			b = true;
			System.out.print("\""+label+"\": {\"x\":"+info.labels.get(label).x+", \"y\":"+info.labels.get(label).y+", \"width\":"+info.labels.get(label).width+", \"height\":"+info.labels.get(label).height+"}");
		}
		System.out.print("}}");
		System.out.println();
		
	}

